DELIMITER $$
CREATE TRIGGER `Total_Products_Price` BEFORE INSERT ON `order_detail` FOR EACH ROW BEGIN
  IF NEW.total_product_price IS NULL THEN
    SET NEW.total_product_price = NEW.amount * (SELECT price FROM products WHERE id_products = NEW.id_product);
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `before_update_order_detail` BEFORE UPDATE ON `order_detail` FOR EACH ROW BEGIN
  -- Verifica si el total_product_price es NULL antes de la actualización
  IF NEW.total_product_price IS NULL THEN
    -- Calcula el nuevo total_product_price multiplicando la cantidad por el precio del producto
    SET NEW.total_product_price = NEW.amount * (SELECT price FROM products WHERE id_products = NEW.id_product);
  END IF;
END
$$
DELIMITER ;

