DELIMITER $$
CREATE TRIGGER `update_stock` BEFORE UPDATE ON `order_dp` FOR EACH ROW BEGIN
    IF NEW.state = 2 AND OLD.state <> 2 THEN
        -- Ajustar el amount en order_detail si la cantidad solicitada es mayor que el stock disponible
        UPDATE order_detail od
        INNER JOIN products p ON p.id_products = od.id_product
        SET od.amount = LEAST(od.amount, p.stock)
        WHERE od.id_order = NEW.id_order;

        -- Eliminar productos de order_detail donde el amount sea 0
        DELETE FROM order_detail
        WHERE id_order = NEW.id_order AND amount = 0;

        -- Actualizar el stock de cada producto en la orden restando la cantidad solicitada
        UPDATE products p
        INNER JOIN order_detail od ON p.id_products = od.id_product
        SET p.stock = GREATEST(0, p.stock - od.amount),
            p.sales = p.sales + od.amount -- Incrementar el atributo sales por el amount
        WHERE od.id_order = NEW.id_order;
    END IF;
END
$$
DELIMITER ;

