DELIMITER $$
--
-- Eventos
--
CREATE DEFINER=`root`@`localhost` EVENT `disable_users` ON SCHEDULE EVERY 10 SECOND STARTS '2024-10-31 00:30:19' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    -- Desactivar usuarios inactivos y marcar como "notificado"
    UPDATE users
    SET active = 0, notified = 1
    WHERE last_connection < DATE_SUB(CURDATE(), INTERVAL 1 YEAR) 
    AND active = 1
    AND notified = 0;
END$$

